import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file with different load strategy
    await page.goto(fileUrl, { waitUntil: 'domcontentloaded' });

    // Wait for search input to be visible
    await page.waitForSelector('#searchInput', { state: 'visible', timeout: 5000 });

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Type in search input to trigger autocomplete
    await page.fill('#searchInput', 'iPhone');

    // Wait for autocomplete suggestions to appear using multiple selector strategies
    await page.waitForSelector('.search-suggestions', { state: 'visible', timeout: 5000 });

    // Take screenshot of autocomplete suggestions
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_autocomplete.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_autocomplete.png'));

    // Extract suggestion text content
    const suggestions = await page.$$eval('.suggestion-item', items => 
      items.map(item => item.textContent.trim())
    );

    return {
      success: true,
      action: "Tested search autocomplete functionality by typing 'iPhone' and capturing suggestions",
      extractedData: {
        searchTerm: 'iPhone',
        suggestionsCount: suggestions.length,
        suggestions: suggestions
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to test search autocomplete functionality",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
